import { AuthorizeList } from '@/api/permission/userSetting'
export default {
  data() {
    return {
      treeData: [],
      info: [],
      activeTab: 'module',
      defaultProps: {
        children: 'children',
        label: 'fullName'
      },
      loading: false
    }
  },
  watch: {
    activeTab(val) {
      this.treeData = this.info[val]
    }
  },
  created() {
    this.getList()
  },
  methods: {
    getList() {
      this.loading = true
      AuthorizeList().then(res => {
        this.info = res.data;
        this.treeData = this.info[this.activeTab]
        this.loading = false
      })
    },
  }
}
